import { Container, TextField } from "@mui/material";
import React from "react";
import Box from "@mui/material/Box";
import Story from "./Story";
import Avatar from "@mui/material/Avatar";
import Button from '@mui/material/Button';
import InsertPhotoIcon from '@mui/icons-material/InsertPhoto';


function Feed() {
  return (
    <div>
      <Container maxWidth="sm">
        <Box
          sx={{
            width: 600,
            height: 350,
          }}
        >
          <Story sx={{ marginTop: "80px" }} />
        </Box>
        <Container fixed sx={{
          width: 450,
          height: 70,
            textAlign: "center",
            background: "white",
            border: 0 ,
            boxShadow: "1px 1px 2px 1px #ccc",
            margin: 4,
            marginTop: "0%"
          }}  >

        <Avatar sx={{
          height: 35,
          width: 35,
            textAlign: "center",
            border: 1 ,
            boxShadow: "1px 1px 2px 1px #ccc",
            margin: 0,
            marginLeft: "-10px",
            marginTop: "-10px",
        

          }} />

         <TextField type="text" placeholder="Add post.."  sx={{ 
           border:0,
           height: 40,
           width: 340,
          background: "whitesmoke",
          marginTop: "-30px"
           }} >
          
        </TextField>
        <label htmlFor="contained-button-file" sx={{
          height: 20,
          width: 20,
          marginTop: "60%"
          }} >
        <Button accept="image/*" id="contained-button-file" multiple type="file" >
          <InsertPhotoIcon sx={{
          height: 20,
          width: 20,
          marginTop: "10px",
          marginRight: "-800%"
          }}  />
        </Button>
        </label>
    
        </Container >
        <Box
          
        />
         <Box
          sx={{
            width: 600,
            height: 300,
            background: "white",
            border: 0 ,
            margin: 4,
            marginLeft: "-40px",
            boxShadow: "1px 1px 2px 1px #ccc"

          }}
        />
      </Container>
    
    </div>
  );
}

export default Feed;
